import React from "react";

const PurchaseDetails = ({state, onChange, changeFlow}) => {
    const handleChangeCheckbox1 = (e) => {
        onChange({purchaseReturned: e.target.checked})
    }

    const handleChangeCheckbox2 = (e) => {
        onChange({companyPurchase:  e.target.checked})
    }
    return <>
        <h1>Czy zakupione produkty</h1>
        <label>
            Zostały zwrócone?
            <input type={"checkbox"} onChange={handleChangeCheckbox1} checked={state.data.purchaseReturned}/>
        </label>
            <br />
            <br />
        <label>
            Zostały kupione na firmę?
            <input type={"checkbox"} onChange={handleChangeCheckbox2} checked={state.data.companyPurchase}/>
        </label>
    </>
}

export default PurchaseDetails
